import React from 'react';

function App() {
  return (
    <div className="App">
      <nav className="light-orange darken-4">
        <div className="container">
          <div className="nav-wrapper">
            <a href="#" className="brand-logo">Ligas Burocraticas Walnic</a>
          </div>
        </div>
      </nav>
    </div>
  );
}

export default App;
